    "contracts/utils/LPToken.sol": {
      "content": "//SPDX-License-Identifier: MIT
pragma solidity ^0.8.16;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract LPToken is ERC20, Ownable {
    uint8 private _decimals;

    struct Origin {
        string name;
        string symbol;
        uint8 decimals;
        address token;
    }
    Origin public coin;

    constructor(
        string memory name_,
        string memory symbol_,
        uint8 decimals_,
        address contract_
    )
        ERC20(
            string(abi.encodePacked("LP ", name_)),
            string(abi.encodePacked("LP", symbol_))
        )
    {
        _decimals = decimals_;
        coin = Origin(name_, symbol_, decimals_, contract_);
    }

    function decimals() public view virtual override returns (uint8) {
        return _decimals;
    }

    function mint(address to, uint256 amount) public onlyOwner {
        _mint(to, amount);
    }

    function burnFrom(address account, uint256 amount) public onlyOwner {
        _burn(account, amount);
    }

    function getContractOrigin() public view returns (Origin memory) {
        return coin;
    }
}
"
    },
    "contracts/utils/NFT.sol": {
      "content": "// SPDX-License-Identifier: MIT
pragma solidity ^0.8.16;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/Counters.sol";

contract NFT is ERC721, Ownable {
    using Counters for Counters.Counter;

    Counters.Counter private _tokenIdCounter;

    constructor(
        string memory name_,
        string memory symbol_
    ) ERC721(name_, symbol_) {}

    function totalSupply() public view returns (uint256) {
        return _tokenIdCounter.current();
    }

    function safeMint(address to) public onlyOwner {
        uint256 tokenId = _tokenIdCounter.current();
        _tokenIdCounter.increment();

        _safeMint(to, tokenId);
    }
}
"
    },
    "contracts/WebDexManager.sol": {
      "content": "//SPDX-License-Identifier: MIT
pragma solidity ^0.8.16;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "./utils/NFT.sol";
import "./utils/LPToken.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";

interface IWebDexPass {
    struct User {
        bool passExpired;
        bool haveFreeTrial;
        uint256 expirationTime;
    }

    function getUserInfoByWallet(
        address to
    ) external view returns (User memory);
}

contract WebDexManager is Ownable {
    IWebDexPass internal webDexPass;

    using SafeERC20 for ERC20;

    struct Bot {
        string name;
        address token;
        address wallet;
        address seller;
    }
    Bot internal bot;

    struct Strategy {
        string name;
        address token;
    }
    Strategy[] internal strategies;

    mapping(address => bool) internal strategyExists;
    mapping(string => bool) internal strategyExistsByName;
    mapping(address => User) internal users;

    struct BalanceStrategy {
        uint256 amount;
        address token;
        uint256 decimals;
        string ico;
        string name;
        bool status;
    }
    struct UserDisplay {
        BalanceStrategy[] balance;
        string strategy;
        address strategyToken;
        bool status;
    }
    struct StrategyBalance {
        mapping(address => BalanceStrategy) balance;
        bool status;
    }
    struct User {
        mapping(address => StrategyBalance) strategies;
        address[] coins;
        address manager;
        bool status;
        uint256 gasBalance;
    }

    struct Register {
        address wallet;
        address manager;
        address strategyToken;
    }
    Register[] internal registers;

    struct Coin {
        bool status;
        LPToken lp;
    }
    mapping(address => Coin) private listCoins;

    struct Display {
        address wallet;
        address manager;
        bool status;
        uint256 gasBalance;
        UserDisplay[] strategies;
        bool passExpired;
        bool haveFreeTrial;
        uint256 expirationTime;
    }

    struct PayFees {
        address wallet;
        uint256 amount_af2;
        uint256 amount_af3;
        uint256 amount_bot;
        uint256 amount_seller;
        address coin;
    }

    event OpenPosition(
        address indexed wallet,
        address indexed coin,
        address indexed strategyToken,
        string output,
        int256 profit,
        int256 gas,
        string[] coins,
        uint256 timeStamp
    );

    event Transaction(
        address indexed from,
        string method,
        uint256 timeStamp,
        address to,
        uint256 value
    );

    constructor(
        string memory name_,
        string memory symbol_,
        address wallet_,
        IWebDexPass webDexPass_,
        address seller_
    ) {
        bot = Bot(
            name_,
            address(
                new NFT(string(abi.encodePacked(name_, " Affiliated")), symbol_)
            ),
            wallet_,
            seller_
        );
        webDexPass = webDexPass_;
    }

    modifier onlyBotWalletOrOwner() {
        require(
            msg.sender == bot.wallet || msg.sender == owner(),
            "You must own the contract or the bot"
        );

        _;
    }

    function addStrategy(
        string memory name,
        string memory symbol
    ) public onlyBotWalletOrOwner {
        require(
            !_strategyExistsByName(name),
            "Name already in use in another strategy"
        );

        NFT newNFT = new NFT(name, symbol);
        address tokenAddress = address(newNFT);

        Strategy memory newStrategy = Strategy(name, tokenAddress);

        strategies.push(newStrategy);
        strategyExists[tokenAddress] = true;
        strategyExistsByName[name] = true;

        emit Transaction(
            msg.sender,
            "Add Strategy",
            block.timestamp,
            address(this),
            0
        );
    }

    function _registerInStrategy(
        address strategyToken,
        address manager
    ) internal {
        require(_strategyExistsByToken(strategyToken), "Strategy not found");
        if (manager != address(0)) {
            require(users[manager].status, "Unregistered manager");
        }

        require(
            !users[msg.sender].strategies[strategyToken].status,
            "User already registered"
        );

        _nftMint(strategyToken, msg.sender);

        users[msg.sender].strategies[strategyToken].status = true;

        if (!users[msg.sender].status) {
            users[msg.sender].gasBalance = 0;
            users[msg.sender].manager = manager;
            users[msg.sender].status = true;
            _nftMint(bot.token, msg.sender);
        }

        registers.push(Register(msg.sender, manager, strategyToken));

        emit Transaction(
            msg.sender,
            manager == address(0)
                ? "Register In Strategy With Manager"
                : "Register In Strategy",
            block.timestamp,
            address(this),
            0
        );
    }

    function registerInStrategy(address strategyToken) public {
        _registerInStrategy(strategyToken, address(0));
    }

    function registerInStrategyWithManager(
        address strategyToken,
        address manager
    ) public {
        _registerInStrategy(strategyToken, manager);
    }

    function _nftMint(address coin, address wallet) internal {
        NFT(coin).safeMint(wallet);
    }

    function addGasInBot() public payable {
        require(msg.value >= 0, "Insufficient value");
        require(users[msg.sender].status, "Unregistered user");

        users[msg.sender].gasBalance += msg.value;

        payable(owner()).transfer(msg.value);

        emit Transaction(
            msg.sender,
            "Add Gas In Bot",
            block.timestamp,
            address(this),
            msg.value
        );
    }

    function addLiquidyInStrategy(
        address strategyToken,
        uint256 amount,
        address coin
    ) public {
        require(_strategyExistsByToken(strategyToken), "Strategy not found");
        require(coin != address(0), "Invalid contract address");
        require(
            users[msg.sender].strategies[strategyToken].status,
            "Unregistered user"
        );

        ERC20 erc20_coin = ERC20(coin);

        if (!listCoins[coin].status) {
            listCoins[coin] = Coin(
                true,
                new LPToken(
                    erc20_coin.name(),
                    erc20_coin.symbol(),
                    erc20_coin.decimals(),
                    coin
                )
            );
        }

        erc20_coin.transferFrom(msg.sender, owner(), amount);
        listCoins[coin].lp.mint(msg.sender, amount);

        if (!users[msg.sender].strategies[strategyToken].balance[coin].status) {
            users[msg.sender].strategies[strategyToken].balance[
                    coin
                ] = BalanceStrategy(
                0,
                coin,
                erc20_coin.decimals(),
                erc20_coin.symbol(),
                erc20_coin.name(),
                true
            );
            users[msg.sender].coins.push(coin);
        }

        users[msg.sender]
            .strategies[strategyToken]
            .balance[coin]
            .amount += amount;

        emit Transaction(
            msg.sender,
            "Add Liquidy In Strategy",
            block.timestamp,
            address(this),
            0
        );
    }

    function removeLiquidyInStrategy(
        address strategyToken,
        uint256 amount,
        address coin
    ) public {
        require(_strategyExistsByToken(strategyToken), "Strategy not found");
        require(listCoins[coin].status, "Invalid contract address");
        require(
            users[msg.sender].strategies[strategyToken].balance[coin].amount >=
                amount,
            "Insufficient funds"
        );

        listCoins[coin].lp.burnFrom(msg.sender, amount);
        users[msg.sender]
            .strategies[strategyToken]
            .balance[coin]
            .amount -= amount;
        _erc20Transf(coin, msg.sender, amount);

        emit Transaction(
            msg.sender,
            "Remove Liquidy In Strategy",
            block.timestamp,
            address(this),
            0
        );
    }

    function getStrategies() public view returns (Strategy[] memory) {
        return strategies;
    }

    function getRegisters() public view returns (Register[] memory) {
        return registers;
    }

    function getBot() public view returns (Bot memory) {
        return bot;
    }

    function openPosition(
        address strategyToken,
        address wallet,
        int256 amount,
        string[] memory coins,
        int256 gas,
        address coin
    ) public onlyOwner {
        require(
            users[wallet].strategies[strategyToken].balance[coin].amount > 0,
            "Insufficient LP tokens"
        );
        require(users[wallet].gasBalance >= uint256(gas), "Insufficient gas");

        if (amount > 0) {
            listCoins[coin].lp.mint(wallet, uint256(amount));
        } else {
            listCoins[coin].lp.burnFrom(wallet, uint256(-1 * amount));
        }

        users[wallet].strategies[strategyToken].balance[coin].amount = uint256(
            int256(
                users[wallet].strategies[strategyToken].balance[coin].amount
            ) + amount
        );

        users[wallet].gasBalance -= uint256(gas);
        uint256 timestamp = block.timestamp;
        emit OpenPosition(
            wallet,
            coin,
            strategyToken,
            amount > 0 ? "win" : "loss",
            amount,
            gas,
            coins,
            timestamp
        );
    }

    function payFees(PayFees[] memory payments) public onlyOwner {
        for (uint256 i = 0; i < payments.length; i++) {
            address affiliate2 = _getManager(_getManager(payments[i].wallet));
            address affiliate3 = _getManager(affiliate2);

            _erc20Transf(payments[i].coin, affiliate2, payments[i].amount_af2);
            _erc20Transf(payments[i].coin, affiliate3, payments[i].amount_af3);
            _erc20Transf(payments[i].coin, bot.wallet, payments[i].amount_bot);
            _erc20Transf(
                payments[i].coin,
                bot.seller,
                payments[i].amount_seller
            );
        }
    }

    function _getManager(address wallet) internal view returns (address) {
        return users[wallet].manager;
    }

    function _erc20Transf(
        address coin,
        address wallet,
        uint256 amount
    ) internal returns (bool) {
        if (coin == address(0) || wallet == address(0)) {
            return false;
        }
        return ERC20(coin).transferFrom(owner(), wallet, amount);
    }

    function getUserInfo() public view returns (Display memory) {
        return _getUser(msg.sender);
    }

    function _getUserInfo(
        address wallet
    ) public view onlyOwner returns (Display memory) {
        return _getUser(wallet);
    }

    function _getUser(address wallet) internal view returns (Display memory) {
        uint256 numCoins = users[wallet].coins.length;
        UserDisplay[] memory strategy = new UserDisplay[](strategies.length);

        for (uint256 i = 0; i < strategies.length; i++) {
            address strategyToken = strategies[i].token;
            BalanceStrategy[] memory balances = new BalanceStrategy[](numCoins);

            for (uint256 c = 0; c < numCoins; c++) {
                address coin = users[wallet].coins[c];
                balances[c] = users[wallet].strategies[strategyToken].balance[
                    coin
                ];
            }
            strategy[i] = UserDisplay(
                balances,
                strategies[i].name,
                strategyToken,
                users[wallet].strategies[strategyToken].status
            );
        }

        IWebDexPass.User memory userInfo = webDexPass.getUserInfoByWallet(
            wallet
        );

        return
            Display(
                wallet,
                users[wallet].manager,
                users[wallet].status,
                users[wallet].gasBalance,
                strategy,
                userInfo.passExpired,
                userInfo.haveFreeTrial,
                userInfo.expirationTime
            );
    }

    function getUsers() public view onlyOwner returns (Display[] memory) {
        Display[] memory list = new Display[](registers.length);
        for (uint256 i = 0; i < registers.length; i++) {
            list[i] = _getUser(registers[i].wallet);
        }

        return list;
    }

    function _strategyExistsByName(
        string memory name
    ) internal view returns (bool) {
        return strategyExistsByName[name];
    }

    function _strategyExistsByToken(
        address token
    ) internal view returns (bool) {
        return strategyExists[token];
    }
}
